import React from "react";
import AssignmentIndIcon from "@mui/icons-material/AssignmentInd";
import SecurityUpdateIcon from "@mui/icons-material/SecurityUpdate";
import { Avatar } from "@mui/material";
import Data from "./Data";
import { useNavigate } from "react-router-dom";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { useParams } from "react-router-dom";
import { getTeacherById } from "../../../redux/actions/adminActions";
const Body = () => {
  const { id } = useParams();
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getTeacherById(id));
  }, [dispatch, id]);
  return (
    <div className="flex-[0.8] mt-3">
      <div className="space-y-5">
        <div className="flex items-center space-x-2 text-gray-400">
          <div className="flex ml-5 space-x-2 text-gray-400">
            <AssignmentIndIcon />
            <h1>Profile</h1>
          </div>
        </div>
        <div className="w-[98%] bg-white relative rounded-xl">
          <div className="absolute left-[50%] top-[-10%]">
            {/* <Avatar src={user.data.avatar} sx={{ width: 70, height: 70 }} /> */}
          </div>
          <div className="flex py-10 ml-10 space-x-40 h-[576px]">
            <div className="flex flex-col space-y-10">
              {/* <Data label="AdminCode" value={user.data.adminCode} />
              <Data label="Last Name" value={user.data.lastname} />
              <Data label="First Name" value={user.data.firstname} />

              <Data label="Email" value={user.data.email} /> */}
            </div>
            <div className="flex flex-col space-y-10 ">
              {/* <Data label="Dob" value={user.data.dob} />
              <Data label="Gender" value={user.data.gender} />
              <Data label="contact Number" value={user.data.contactNumber} /> */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Body;
